INSERT INTO `t_article` VALUES (1,1,1,'查看一下标题可以有多长哦','','\n\nFlowChart\n左右结构\n```mermaid\ngraph LR\n    A[公司] -->| 下 班 | B(菜市场)\n    B --> C{看见<br>卖西瓜的}\n    C -->|Yes| D[买一个包子]\n    C -->|No| E[买一斤包子]\n```\n上下结构\n```mermaid\ngraph TD\n    A[公司] -->| 下 班 | B(菜市场)\n    B --> C{看见<br>卖西瓜的}\n    C -->|Yes| D[买一个包子]\n    C -->|No| E[买一斤包子]\n```\n\n\nSequenceDiagram\n```mermaid\nsequenceDiagram\nautonumber\nA-->A: 文本1\nA->>B: 文本2\nloop 循环1\nloop 循环2\nA->B: 文本3\nend\nloop 循环3\nB -->>A: 文本4\nend\nB -->> B: 文本5\nend\n```\n\nStateDiagram\n```mermaid\nstateDiagram-v2\n[*] --> A\nA --> B\nA --> C\nstate A {\n      [*] --> D\n      D --> [*]\n}\nB --> [*]\nC --> [*]\n```\n\n\nClassDiagram\n```mermaid\nclassDiagram\nBase <|-- One\nBase <|-- Two\nBase : +String name\nBase: +getName()\nBase: +setName(String name)\nclass One{\n      +String newName\n      +getNewName()\n}\nclass Two{\n      -int id\n      -getId()\n}\n```\n\n\n\nPieChart\n```mermaid\npie\ntitle 饼图\n\"A\" : 100\n\"B\" : 80\n\"C\" : 40\n\"D\" : 30\n```\n\n\nGanttChart\n```mermaid\ngantt\n    title 敏捷研发流程\n    section 迭代前\n        交互设计     :a1, 2020-03-01, 4d\n        UI设计        :after a1, 5d\n        需求评审     : 1d\n    section 迭代中\n        详细设计      :a2, 2020-03-11, 2d\n        开发          :2020-03-15, 7d\n        测试          :2020-03-22, 5d\n    section 迭代后\n        发布: 1d\n        验收: 2d\n        回顾: 1d\n```\n','draft','','','','我',0,'public','2023-09-05 23:36:40','2023-09-06 02:20:20',0),(2,1,NULL,'草稿','http://wbxnl-blog.oss-cn-chengdu.aliyuncs.com/images/_15498453651678239037829_1de5159fb88f492a666a1976f5495f43.jpg','\n\nPieChart\n```mermaid\npie\ntitle 饼图\n\"A\" : 100\n\"B\" : 80\n\"C\" : 40\n\"D\" : 30\n```\n\n\nStateDiagram\n```mermaid\nstateDiagram-v2\n[*] --> A\nA --> B\nA --> C\nstate A {\n      [*] --> D\n      D --> [*]\n}\nB --> [*]\nC --> [*]\n```\n','draft','','','','',0,'public','2023-09-06 09:26:20','2023-09-06 16:27:44',0),(3,1,1,'哈哈哈','http://','\n\nFlowChart\n左右结构\n```mermaid\ngraph LR\n    A[公司] -->| 下 班 | B(菜市场)\n    B --> C{看见<br>卖西瓜的}\n    C -->|Yes| D[买一个包子]\n    C -->|No| E[买一斤包子]\n```\n上下结构\n```mermaid\ngraph TD\n    A[公司] -->| 下 班 | B(菜市场)\n    B --> C{看见<br>卖西瓜的}\n    C -->|Yes| D[买一个包子]\n    C -->|No| E[买一斤包子]\n```\n\nSequenceDiagram\n```mermaid\nsequenceDiagram\nautonumber\nA-->A: 文本1\nA->>B: 文本2\nloop 循环1\nloop 循环2\nA->B: 文本3\nend\nloop 循环3\nB -->>A: 文本4\nend\nB -->> B: 文本5\nend\n```\n\n\nStateDiagram\n```mermaid\nstateDiagram-v2\n[*] --> A\nA --> B\nA --> C\nstate A {\n      [*] --> D\n      D --> [*]\n}\nB --> [*]\nC --> [*]\n```\n\n\n\n\nClassDiagram\n```mermaid\nclassDiagram\nBase <|-- One\nBase <|-- Two\nBase : +String name\nBase: +getName()\nBase: +setName(String name)\nclass One{\n      +String newName\n      +getNewName()\n}\nclass Two{\n      -int id\n      -getId()\n}\n```\n\nPieChart\n```mermaid\npie\ntitle 饼图\n\"A\" : 100\n\"B\" : 80\n\"C\" : 40\n\"D\" : 30\n```\n\nClassDiagram\n```mermaid\nclassDiagram\nBase <|-- One\nBase <|-- Two\nBase : +String name\nBase: +getName()\nBase: +setName(String name)\nclass One{\n      +String newName\n      +getNewName()\n}\nclass Two{\n      -int id\n      -getId()\n}\n```\n\n\n','original','','','','',0,'public','2023-09-06 16:24:38','2023-09-06 17:48:49',0),(4,1,NULL,'测试markdown的保存日志','','\n\nFlowChart\n左右结构\n```mermaid\n\n\nFlowChart\n左右结构\n```mermaid\ngraph LR\n    A[公司] -->| 下 班 | B(菜市场)\n    B --> C{看见<br>卖西瓜的}\n    C -->|Yes| D[买一个包子]\n    C -->|No| E[买一斤包子]\n```\n上下结构\n```mermaid\ngraph TD\n    A[公司] -->| 下 班 | B(菜市场)\n    B --> C{看见<br>卖西瓜的}\n    C -->|Yes| D[买一个包子]\n    C -->|No| E[买一斤包子]\n```\n\n```\n\n\nStateDiagram\n```mermaid\nstateDiagram-v2\n[*] --> A\nA --> B\nA --> C\nstate A {\n      [*] --> D\n      D --> [*]\n}\nB --> [*]\nC --> [*]\n```\n\n\nGanttChart\n```mermaid\ngantt\n    title 敏捷研发流程\n    section 迭代前\n        交互设计     :a1, 2020-03-01, 4d\n        UI设计        :after a1, 5d\n        需求评审     : 1d\n    section 迭代中\n        详细设计      :a2, 2020-03-11, 2d\n        开发          :2020-03-15, 7d\n        测试          :2020-03-22, 5d\n    section 迭代后\n        发布: 1d\n        验收: 2d\n        回顾: 1d\n```\n','draft','','','','',0,'','2023-09-08 14:01:02','2023-09-08 14:01:02',0),(5,1,NULL,'测试代码主题','','```javascript\n<script setup lang=\"ts\">\nimport \"cherry-markdown/dist/cherry-markdown.css\";\nimport Cherry from \"cherry-markdown\";\nimport { onMounted, ref, toRefs, watch } from \"vue\";\nimport { onActivated } from \"vue\";\nimport { onDeactivated } from \"vue\";\nimport { onBeforeMount } from \"vue\";\nimport { onBeforeUnmount } from \"vue\";\n// import mermaid from \"mermaid\";\nimport * as echarts from \"echarts\";\nimport katex from \"katex\";\nimport Mathjax from \"mathjax\";\n// import * as pinyin from \"./scripts/pinyin/pinyin_dist.js\";\n\ndefineOptions({\n  name: \"CherryMarkdown\"\n});\n\nconst ossUrl = import.meta.env.VITE_GLOB_OSS_URL;\nconst props = defineProps({\n  id: {\n    type: String,\n    default: \"cherryMarkdown\",\n    required: true\n  },\n  value: {\n    type: String,\n    default: \"\",\n    required: true\n  },\n  height: { type: Number, default: 360 },\n  dir: {\n    type: String,\n    default: \"default\"\n  }\n});\nconst emits = defineEmits([\"change\", \"get\", \"update:value\"]);\nconst { id, value, height, dir } = toRefs(props);\n\n// TODO 同步进行，获取数据后才开始加载页面\n// const valueWatch = watch(value, () => {\n//   // 获取并设置文章初始内容\n//   // console.log(\"change value：\\n\", value.value);\n//   // TODO BUG  设置初始值时,光标错乱\n\n//   contentValue.value = value.value;\n//   cherryInstance.value?.insertValue(value.value, false);\n\n//   // console.log(\"cherryInstance.value?.getStatus()\",cherryInstance.value?.getStatus());\n//   // 监听一次,为了获取编辑时的文章内容\n//   valueWatch();\n// });\nconst contentValue = ref<string>(value.value);\nconst cherryInstance = ref<Cherry>();\nconst cherryDom = ref<HTMLDivElement>();\n\n/**\n * 自定义一个语法\n */\nconst CustomHookA = Cherry.createSyntaxHook(\n  \"codeBlock\",\n  Cherry.constants.HOOKS_TYPE_LIST.PAR,\n  {\n    makeHtml(str) {\n      console.warn(\"custom hook\", \"hello\");\n      return str;\n    },\n    rule(str) {\n      const regex = {\n        begin: \"\",\n        content: \"\",\n        end: \"\",\n        reg: null\n      };\n      regex.reg = new RegExp(regex.begin + regex.content + regex.end, \"g\");\n      return regex;\n    }\n  }\n);\n/**\n * 自定义一个自定义菜单\n * 点第一次时，把选中的文字变成同时加粗和斜体\n * 保持光标选区不变，点第二次时，把加粗斜体的文字变成普通文本\n */\nconst customMenuA = Cherry.createMenuHook(\"加粗斜体\", {\n  iconName: \"font\",\n  onClick: function (selection) {\n    // 获取用户选中的文字，调用getSelection方法后，如果用户没有选中任何文字，会尝试获取光标所在位置的单词或句子\n    let $selection = this.getSelection(selection) || \"同时加粗斜体\";\n    // 如果是单选，并且选中内容的开始结束内没有加粗语法，则扩大选中范围\n    if (!this.isSelections && !/^\\s*(\\*\\*\\*)[\\s\\S]+(\\1)/.test($selection)) {\n      this.getMoreSelection(\"***\", \"***\", () => {\n        const newSelection = this.editor.editor.getSelection();\n        const isBoldItalic = /^\\s*(\\*\\*\\*)[\\s\\S]+(\\1)/.test(newSelection);\n        if (isBoldItalic) {\n          $selection = newSelection;\n        }\n        return isBoldItalic;\n      });\n    }\n    // 如果选中的文本中已经有加粗语法了，则去掉加粗语法\n    if (/^\\s*(\\*\\*\\*)[\\s\\S]+(\\1)/.test($selection)) {\n      return $selection.replace(\n        /(^)(\\s*)(\\*\\*\\*)([^\\n]+)(\\3)(\\s*)($)/gm,\n        \"$1$4$7\"\n      );\n    }\n    /**\n     * 注册缩小选区的规则\n     *    注册后，插入“***TEXT***”，选中状态会变成“***【TEXT】***”\n     *    如果不注册，插入后效果为：“【***TEXT***】”\n     */\n    this.registerAfterClickCb(() => {\n      this.setLessSelection(\"***\", \"***\");\n    });\n    return $selection.replace(/(^)([^\\n]+)($)/gm, \"$1***$2***$3\");\n  }\n});\n/**\n * 定义一个空壳，用于自行规划cherry已有工具栏的层级结构\n */\nconst customMenuB = Cherry.createMenuHook(\"实验室\", {\n  iconName: \"\"\n});\nconst callbacks = {\n  /**\n   * 全局的URL处理器\n   * @param {string} url 来源url\n   * @param {\'image\'|\'audio\'|\'video\'|\'autolink\'|\'link\'} srcType 来源类型\n   * @returns\n   */\n  urlProcessor: (\n    url: string,\n    srcType: \"image\" | \"audio\" | \"video\" | \"autolink\" | \"link\"\n  ) => url,\n  /**\n   * 上传文件回调\n   */\n  fileUpload(\n    file: File,\n    callback: (path: string, arg: { [key: string]: any }) => void\n  ) {\n    console.log(file);\n    const fileUrl = URL.createObjectURL(file);\n    console.log(\"url\", fileUrl);\n    if (/video/i.test(file.type)) {\n      callback(fileUrl, {\n        name: `${file.name.replace(/\\.[^.]+$/, \"\")}`,\n        poster: \"/favicon.ico\",\n        isBorder: true,\n        isShadow: true,\n        isRadius: true,\n        width: \"300px\",\n        height: \"auto\"\n      });\n    } else {\n      callback(fileUrl, {\n        name: `${file.name.replace(/\\.[^.]+$/, \"\")}`,\n        isShadow: true\n      });\n    }\n  },\n  afterChange: (text: string, html: string) => {\n    // 是否改变\n    // console.log(\"text\",text);\n    // console.log(\"htmlStr\",htmlStr);\n    contentValue.value = text;\n    emits(\"update:value\", text);\n    emits(\"change\", text);\n  },\n  afterInit: (text: string, html: string) => {\n    emits(\"get\", cherryInstance);\n  },\n  beforeImageMounted: (srcProp: string, src: string) => ({ srcProp, src }),\n  // 预览区域点击事件，previewer.enablePreviewerBubble = true 时生效\n  onClickPreview: (event: Event) => {},\n  // 复制代码块代码时的回调\n  onCopyCode: (event: Event, code: string) => {\n    // 阻止默认的粘贴事件\n    // return false;\n    // 对复制内容进行额外处理\n    return code;\n  },\n  // 获取中文的拼音\n  changeString2Pinyin: (string: string) => {\n    /**\n     * 推荐使用这个组件：https://github.com/liu11hao11/pinyin_js\n     *\n     * 可以在 ../scripts/pinyin/pinyin_dist.js 里直接引用\n     */\n    // return pinyin.pinyin(string, \" \");\n    return string;\n  }\n};\n\nconst config = {\n  id: id.value,\n  value: contentValue.value,\n  editor: {\n    height: height.value + \"px\",\n    id: \"code\",\n    name: \"code\",\n    autoSave2Textarea: true,\n    // defaultModel 编辑器初始化后的默认模式，一共有三种模式：1、双栏编辑预览模式；2、纯编辑模式；3、预览模式\n    // edit&preview: 双栏编辑预览模式\n    // editOnly: 纯编辑模式（没有预览，可通过toolbar切换成双栏或预览模式）\n    // previewOnly: 预览模式（没有编辑框，toolbar只显示“返回编辑”按钮，可通过toolbar切换成编辑模式）\n    defaultModel: \"edit&preview\",\n\n    convertWhenPaste: true,\n\n    codemirror: {\n      // 是否自动focus 默认为true\n      autofocus: true\n    }\n  },\n  // externals: {\n  //   echarts: echarts,\n  //   katex: katex\n  //   // MathJax: MathJax TODO\n  // },\n  isPreviewOnly: false,\n  fileTypeLimitMap: {\n    video: \"video/*\",\n    audio: \"audio/*\",\n    image: \"image/*\",\n    word: \".doc,.docx\",\n    pdf: \".pdf\",\n    file: \"*\"\n  },\n  previewer: {\n    dom: false,\n    className: \"cherry-markdown\",\n    enablePreviewerBubble: true,\n    /**\n     * 配置图片懒加载的逻辑\n     * - 如果不希望图片懒加载，可配置成 lazyLoadImg = {noLoadImgNum: -1}\n     * - 如果希望所有图片都无脑懒加载，可配置成 lazyLoadImg = {noLoadImgNum: 0, autoLoadImgNum: -1}\n     * - 如果一共有15张图片，希望：\n     *    1、前5张图片（1~5）直接加载；\n     *    2、后5张图片（6~10）不论在不在视区内，都无脑懒加载；\n     *    3、其他图片（11~15）在视区内时，进行懒加载；\n     *    则配置应该为：lazyLoadImg = {noLoadImgNum: 5, autoLoadImgNum: 5}\n     */\n    lazyLoadImg: {\n      // 加载图片时如果需要展示loading图，则配置loading图的地址\n      loadingImgPath: \"\",\n      maxNumPerTime: 2,\n      // 不进行懒加载处理的图片数量，如果为0，即所有图片都进行懒加载处理， 如果设置为-1，则所有图片都不进行懒加载处理\n      noLoadImgNum: 5,\n      autoLoadImgNum: 5,\n      maxTryTimesPerSrc: 2,\n      // 加载一张图片之前的回调函数，函数return false 会终止加载操作\n      beforeLoadOneImgCallback: (img: HTMLImageElement) => true,\n      // 加载一张图片失败之后的回调函数\n      failLoadOneImgCallback: (img: HTMLImageElement) => {},\n      // 加载一张图片之后的回调函数，如果图片加载失败，则不会回调该函数\n      afterLoadOneImgCallback: (img: HTMLImageElement) => {},\n      // 加载完所有图片后调用的回调函数\n      afterLoadAllImgCallback: () => {}\n    }\n  },\n  engine: {\n    // 全局配置\n    global: {\n      // 是否启用经典换行逻辑\n      // true：一个换行会被忽略，两个以上连续换行会分割成段落，\n      // false： 一个换行会转成<br>，两个连续换行会分割成段落，三个以上连续换行会转成<br>并分割段落\n      classicBr: false,\n      /**\n       * 全局的URL处理器\n       * @param {string} url 来源url\n       * @param {\'image\'|\'audio\'|\'video\'|\'autolink\'|\'link\'} srcType 来源类型\n       * @returns\n       */\n      urlProcessor: (url, srcType) => {\n        console.log(`url-processor`, url, srcType);\n        return url;\n      },\n      /**\n       * 额外允许渲染的html标签\n       * 标签以英文竖线分隔，如：htmlWhiteList: \'iframe|script|style\'\n       * 默认为空，默认允许渲染的html见src/utils/sanitize.js whiteList 属性\n       * 需要注意：\n       *    - 启用iframe、script等标签后，会产生xss注入，请根据实际场景判断是否需要启用\n       *    - 一般编辑权限可控的场景（如api文档系统）可以允许iframe、script等标签\n       */\n      htmlWhiteList: \"\"\n    },\n    // 内置语法配置\n    syntax: {\n      // 语法开关\n      // \'hookName\': false,\n      // 语法配置\n      // \'hookName\': {\n      //\n      // }\n      codeBlock: {\n        theme: \"twilight\",\n        // 超出长度是否换行，false则显示滚动条\n        wrap: false,\n        lineNumber: true,\n        // 是否显示“复制”按钮\n        copyCode: true\n      },\n      list: {\n        listNested: false,\n        // 同级列表类型转换后变为子级\n        indentSpace: 2 // 默认2个空格缩进\n      },\n      table: {\n        enableChart: false\n        // chartEngine: Engine Class\n      },\n      fontEmphasis: {\n        /**\n         * 是否允许首尾空格\n         * 首尾、前后的定义： 语法前**语法首+内容+语法尾**语法后\n         * 例：\n         *    true:\n         *           __ hello __  ====>   <strong> hello </strong>\n         *           __hello__    ====>   <strong>hello</strong>\n         *    false:\n         *           __ hello __  ====>   <em>_ hello _</em>\n         *           __hello__    ====>   <strong>hello</strong>\n         */\n        allowWhitespace: false // 是否允许首尾空格\n      },\n      strikethrough: {\n        /**\n         * 是否必须有前后空格\n         * 首尾、前后的定义： 语法前**语法首+内容+语法尾**语法后\n         * 例：\n         *    true:\n         *            hello wor~~l~~d     ====>   hello wor~~l~~d\n         *            hello wor ~~l~~ d   ====>   hello wor <del>l</del> d\n         *    false:\n         *            hello wor~~l~~d     ====>   hello wor<del>l</del>d\n         *            hello wor ~~l~~ d     ====>   hello wor <del>l<